            }
            let tableRows = displayData.map(item => `<tr style="border-bottom:1px solid #2d3f54"><td class="px-6 py-4"><span class="inline-flex items-center justify-center w-8 h-8 rounded-full font-black text-sm" style="background:linear-gradient(to bottom,#f59e0b,#d97706);border-bottom:2px solid #b45309;color:#1a2332">${item.rank}</span></td><td class="px-6 py-4 font-mono text-sm">${formatAddress(item.address)}</td><td class="px-6 py-4 text-right font-semibold" style="color:#fbbf24">${formatNumber(item.plunder)}</td></tr>`).join('');
            document.getElementById('app').innerHTML = `<h1 class="text-center text-4xl font-black mb-2 tracking-wide">Plunder Dashboard</h1><p class="text-center mb-8" style="color:#a0b4c8">Total Wallets: ${formatNumber(allData.length)}</p><div class="rounded-lg p-6 mb-6 shadow-2xl" style="background:#253345;border:1px solid #2d3f54"><h2 class="text-xl mb-4">Wallet Checker</h2><div class="flex gap-3 mb-4"><input type="text" id="searchInput" placeholder="Enter wallet address (0x...)" class="flex-1 px-4 py-3 rounded-lg text-sm" style="background:#1a2332;border:1px solid #2d3f54"><button onclick="handleSearch()" class="px-6 py-3 rounded-lg font-black" style="background:linear-gradient(to bottom,#f59e0b,#d97706);border-bottom:3px solid #b45309;color:#1a2332">Search</button></div>${searchHTML}<p class="text-sm text-center mt-4 italic" style="color:#a0b4c8">Plunder allocation will be airdropped to those with 1 million or more plunder certificates</p></div><div class="rounded-lg overflow-hidden shadow-2xl" style="background:#253345;border:1px solid #2d3f54"><table class="w-full"><thead style="background:#1a2332"><tr style="border-bottom:1px solid #2d3f54"><th class="px-6 py-4 text-left text-sm font-semibold" style="color:#a0b4c8">Rank</th><th class="px-6 py-4 text-left text-sm font-semibold" style="color:#a0b4c8">Wallet Address</th><th class="px-6 py-4 text-right text-sm font-semibold" style="color:#a0b4c8">Plunder</th></tr></thead><tbody>${tableRows}</tbody></table><div class="px-6 py-4 text-center text-sm" style="background:#1a2332;border-top:1px solid #2d3f54;color:#a0b4c8">Showing top 100 wallets of ${formatNumber(allData.length)} total</div></div><div class="text-center text-base italic mt-8 pt-6" style="color:#a0b4c8;border-top:1px solid #2d3f54">Yours in plunder, the ticker is $PIRATE.</div>`;
            const si = document.getElementById('searchInput');
            if (si) si.addEventListener('keypress', e => { if (e.key === 'Enter') handleSearch(); });
        }
        init();
    </script>
</body>
</html>
